import React from 'react';
import behanceIcon from '/img/be.png';
import twitterIcon from '/img/twitter.png';
import facebookIcon from '/img/facebook.png';
import youtubeIcon from '../img/youtube.png';

class Footer extends React.Component {
  render() {
    return (
      <div>
        <div className="footer-background"></div>  

        <div className="footer-icons">
          <a href="https://behance.net" target="_blank" rel="noopener noreferrer" aria-label="Behance">
            <img src={behanceIcon} alt="Behance" width="22" height="14" />
          </a>
          <a href="https://twitter.com" target="_blank" rel="noopener noreferrer" aria-label="Twitter">
            <img src={twitterIcon} alt="Twitter" width="19" height="15" />
          </a>
          <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" aria-label="Facebook">
            <img src={facebookIcon} alt="Facebook" width="9" height="17" />
          </a>
          <a href="https://youtube.com" target="_blank" rel="noopener noreferrer" aria-label="YouTube">
            <img src={youtubeIcon} alt="YouTube" width="24" height="17" />
          </a>
        </div>
        <div className="footer-text">
          Â© Carlo Ciccarelli 2022.
        </div>
      </div>
    );
  }
}


export default Footer;
